        {id: 2, name: 'fruit', marketName : 'badr-shop', client: 'henni'},
        {id: 3, name: 'k-chire', marketName : 'city-shop', client: 'ghoulam'}
    ])
    return (
        <div className="home">
            { orders.map((order) => (
                <div className="order-previw" key={order.id}>
                    <h2>In the {order.marketName}</h2>
                    <p>Mr {order.client} order {order.name}</p>
                </div>
            )

            )

             }

        </div>
    );
}
 
